import React from 'react';

const Dashboard = () => {
  const [message, setMessage] = useState("");

  useEffect(() => {
    fetch("http://localhost:8000/message")
      .then((res) => res.json())
      .then((data) => setMessage(data.message));
  }, []);

  return <div>
    Welcome to StudentHealth Insight!
    </div>;
};

export default Dashboard;
